import React from "react";

const ProductSection = () => {
  const products = [
    { id: 1, img: "/images/product/1.jpg", name: "Necklace", price: "₹75,999" },
    { id: 2, img: "/images/product/2.jpg", name: "Bracelet", price: "₹25,999" },
    { id: 3, img: "/images/product/3.jpg", name: "Earrings", price: "₹15,999" },
  ];

  return (
    <section className="product_section">
      <div className="container">
        <h2>Our Products</h2>
        <div className="product_grid">
          {products.map(product => (
            <div key={product.id} className="product_card">
              <img src={product.img} alt={product.name} />
              <h3>{product.name}</h3>
              <p>{product.price}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default ProductSection;
